sourcesContent:
import NFT from "../models/MintNFTs";
import { ethers } from "ethers";
import contractABI from "../config/contractABI.json";
import dotenv from 'dotenv';
dotenv.config();

const contractAddress = process.env.contractAddress; // a ch contract

const provider = new ethers.providers.JsonRpcProvider(process.env.RPC_URL);
const signer = new ethers.Wallet(process.env.PRIVATE_KEY, provider);
const contract = new ethers.Contract(process.env.contractAddress, contractABI, signer);

export const getAllNFTs = async (req, res) => {
  const nfts = await NFT.findAll();
  res.json(nfts);
};

export const mintNFT = async (req, res) => {
  try {
    const { to, tokenId, amount } = req.body;
    const tx = await contract.mint(to, tokenId, amount);
    const receipt = await tx.wait();

    const newNFT = await NFT.create({
      tokenId,
      owner: to,
      amount,
      txHash: receipt.transactionHash,
      status: "minted",
      mintedAt: new Date(),
    });

    res.json({ success: true, nft: newNFT });
  } catch (error) {
    res.status(500).json({ error: "Mint failed", details: error.message });
  }
};

// Ly NFT theo a ch v
export const getNFTsByAddress = async (req, res) => {
  const { address } = req.params;
  const nfts = await NFT.findAll({ where: { owner: address } });
  res.json(nfts);
};

