sourcesContent:
import { ethers } from "ethers";
import ContractABI from "../config/contractABI.json"
import dotenv from "dotenv";
dotenv.config();


// V d cu hnh provider v contract
const provider = new ethers.providers.JsonRpcProvider(process.env.RPC_URL);
const contractAddress = process.env.CONTRACT_ADDRESS;

const contract = new ethers.Contract(contractAddress, ContractABI, provider);

export const CheckStatus = async (req, res) => {
  try {
    const rawTokenId = req.params.tokenId;

    if (!rawTokenId) {
      return res.status(400).json({ error: "Missing tokenId parameter" });
    }

    const tokenId = ethers.BigNumber.from(rawTokenId); // Chuyn sang BigNumber nu cn

    console.log("Token ID nhn c:", tokenId.toString());

    // Gi hm getTokenStatus trong contract
    const result = await contract.getTokenStatus(tokenId);

    const data = {
      currentSupply: result[0].toString(),
      maxSupplyForToken: result[1].toString(),
      uniqueMinters: result[2].toString(),
      isActive: result[3],
      isFull: result[4],
      timeRemaining: result[5].toString(),
      status: result[6],
    };

    // Ngoi ra nu mun ly ring startTimestamp
    const startTimestamp = await contract.startTimestamp(tokenId);
    const endTimestamp = await contract.endTimestamp(tokenId);

    return res.json({
      startTimestamp: startTimestamp.toString(),
      endTimestamp : endTimestamp.toString(),
      tokenStatus: data,
    });
  } catch (error) {
    console.error("CheckStatus error:", error);
    return res.status(500).json({ error: "Internal server error" });
  }
};

