import express from "express";
import { mintNFT , countUniqueWallets , currentSupply } from "../controllers/MintNFTs";
import { CheckStatus } from "../controllers/CheckStatus";
import { setTokenConfig , getTokenConfig } from "../controllers/NFTsConfig";
let router = express.Router();

let initWebRoutes = (app) => {
    router.post("/mint",mintNFT); 
    router.get("/count-unique-wallets", countUniqueWallets);
    router.get("/currentSupply", currentSupply);
    router.get("/CheckStatus/:tokenId",CheckStatus);
    router.post("/setTokenConfig", setTokenConfig);
    router.get("/getTokenConfig/:tokenId",getTokenConfig);
    
    router.get('/', (req, res) => {
        res.send('Welcome to the API');
    });

    return app.use("/", router);
}

module.exports = initWebRoutes;

