const { ethers } = require("ethers");
require("dotenv").config();
const { nft_mints } = require('../models');
import abi from "../config/contractABI.json";


const provider = new ethers.providers.JsonRpcProvider(process.env.RPC_URL); // RPC ca TTTChain
const signer = new ethers.Wallet("de1fb4c23bbd4ab579e6a2905b7a99a9c2334dd6c2a639bcfc21d223d87f1199", provider); // Thay PRIVATE_KEY bng private key ca bn

const CONTRACT_ADDRESS = process.env.CONTRACT_ADDRESS;


const contract = new ethers.Contract(CONTRACT_ADDRESS, abi, signer);


const mintFee = ethers.utils.parseEther("0.0001");

export const mintNFT = async (req, res) => {
    try {
      const { to, tokenId} = req.body;
      const amount = 1 ;

      if (!to || !tokenId || !amount) {
        return res.status(400).json({ error: "Missing required fields: to, tokenId, or amount" });
      }
  
      if (!ethers.utils.isAddress(to)) {
        return res.status(400).json({ error: "Invalid wallet address" });
      }
  
      if (isNaN(tokenId) || isNaN(amount) || amount <= 0) {
        return res.status(400).json({ error: "Invalid tokenId or amount" });
      }
      const totalPrice = BigInt(mintFee) * BigInt(amount);

      const feeData = await provider.getFeeData();

      const tx = await contract.mint(to, tokenId, amount, {
        value: totalPrice,
        gasLimit: 300000,
        maxFeePerGas  : feeData.maxFeePerGas || ethers.utils.parseUnits("50", "gwei"),
        maxPriorityFeePerGas : feeData.maxPriorityFeePerGas || ethers.utils.parseUnits("5", "gwei"),
      });
      await tx.wait();
  
      await nft_mints.create({
        user_address: to,
        tokenId: tokenId,
        amount: amount,
        tx_hash: tx.hash,
        mint_time: new Date(),
      });
      res.json({
        message: " Mint successful",
        txHash: tx.hash,
        to,
        tokenId,
        amount
      });
    } catch (err) {
      console.error(" Mint error:", err);
      res.status(500).json({ error: err.message || "Internal server error" });
    }
};

// prepare: Ghi trc log pending
export const prepare = async (req, res) => {
  try {
    const { to, tokenId } = req.body;
    const amount = 1;

    if (!to || !tokenId) {
      return res.status(400).json({ error: "Missing required fields" });
    }

    const log = await nft_mints.create({
      tx_hash: "gi tr hash giao dch",
      mint_time: new Date(),
      user_address: to,
      tokenId,
      amount,
      status: "pending",
    });

    res.json({ message: "Prepared", logId: log.id });
  } catch (err) {
    res.status(500).json({ error: err.message || "Internal error" });
  }
};

// confirm: Gi tx v cp nht log
export const confirm = async (req, res) => {
  try {
    const { logId } = req.body;
    const log = await nft_mints.findByPk(logId);
    if (!log) return res.status(404).json({ error: "Mint log not found" });

    const { user_address: to, tokenId, amount } = log;
    const totalPrice = BigInt(mintFee) * BigInt(amount);
    const feeData = await provider.getFeeData();

    const tx = await contract.mint(to, tokenId, amount, {
      value: totalPrice,
      gasLimit: 300000,
      maxFeePerGas: feeData.maxFeePerGas,
      maxPriorityFeePerGas: feeData.maxPriorityFeePerGas,
    });

    const receipt = await tx.wait();

    await log.update({
      tx_hash: tx.hash,
      mint_time: new Date(),
      blockNumber: receipt.blockNumber,
      status: "success",
    });

    res.json({
      message: " Mint successful",
      txHash: tx.hash,
      to,
      tokenId,
      amount,
    });
  } catch (err) {
    console.error(err);
    res.status(500).json({ error: err.message || "Confirm failed" });
  }
};

// failed: cp nht trng thi tht bi th cng
export const failed = async (req, res) => {
  try {
    const { logId, error } = req.body;
    const log = await nft_mints.findByPk(logId);
    if (!log) return res.status(404).json({ error: "Log not found" });

    await log.update({
      status: "failed",
      error_message: error || "User cancelled or unknown error",
    });

    res.json({ message: "Updated to failed" });
  } catch (err) {
    res.status(500).json({ error: err.message });
  }
};


export const countUniqueWallets = async (req, res) => {
  try {
    const count = await nft_mints.count({
      distinct: true,
      col: 'user_address',
    });

    return res.json({
      uniqueWallets: count,
    });
  } catch (error) {
    console.error("Error counting unique wallets:", error);
    return res.status(500).json({ error: "Internal server error" });
  }
};

export const currentSupply = async (req,res) => {
  try {
    const totalMint = await nft_mints.sum('amount');
    res.json({ total_amount: totalMint });
  }catch (error) {
    res.status(500).json({ error: error.message });
}
}

