const { ethers } = require("ethers");
const { nft_setConfig } = require("../models");
import abi from "../config/contractABI.json";
require("dotenv").config();

const provider = new ethers.providers.JsonRpcProvider(process.env.RPC_URL); // RPC ca TTTChain
const signer = new ethers.Wallet(process.env.PRIVATE_KEY, provider); // Thay PRIVATE_KEY bng private key ca bn

const CONTRACT_ADDRESS = process.env.CONTRACT_ADDRESS;


const contract = new ethers.Contract(CONTRACT_ADDRESS, abi, signer);

export const setTokenConfig = async (req, res) => {
  try {
    const {
      tokenId = 1,
      maxSupply = 100,
      startHour = 7,
      startMinute = 5,
      duration = 5*60,
    } = req.body;

    const now = new Date();
    now.setUTCHours(startHour);
    now.setUTCMinutes(startMinute);
    now.setUTCSeconds(0);
    now.setUTCMilliseconds(0);

    const startTimestamp = Math.floor(now.getTime() / 1000);

    const tx = await contract.setTokenConfig(tokenId, maxSupply, startTimestamp, duration);
    await tx.wait();

    const tokenConfig = await nft_setConfig.create({
      tokenId,
      maxSupply,
      startTimestamp,
      duration,
      endTimestramp: startTimestamp + duration 
    });

    res.status(200).json({
      message: " Token config set and saved successfully.",
      data: tokenConfig
    });
  } catch (err) {
    res.status(500).json({ error: err.message });
  }
};

export const getTokenConfig = async (req, res) => {
  try {
    const { tokenId } = req.params; 

    const config = await nft_setConfig.findOne({
      where: { tokenId }
    });

    if (!config) {
      return res.status(404).json({ error: "Config not found" });
    }

    res.status(200).json({
      tokenId: config.tokenId,
      maxSupply: config.maxSupply,
      startTimestamp: config.startTimestamp,
      duration: config.duration,
      endTimestramp: config.endTimestramp
    });
  } catch (err) {
    res.status(500).json({ error: err.message });
  }
};

