'use strict';
const {
  Model
} = require('sequelize');
module.exports = (sequelize, DataTypes) => {
  class nft_setConfig extends Model {
    /**
     * Helper method for defining associations.
     * This method is not a part of Sequelize lifecycle.
     * The `models/index` file will call this method automatically.
     */
    static associate(models) {
        
    }
  }
  nft_setConfig.init({
    tokenId: {
        type: DataTypes.INTEGER,
        allowNull: false
      },
      maxSupply: {
        type: DataTypes.INTEGER,
        allowNull: false
      },
      startTimestamp: {
        type: DataTypes.BIGINT,
        allowNull: false
      },
      duration: {
        type: DataTypes.BIGINT,
        allowNull: false
      },
      endTimestramp: {
        type: DataTypes.BIGINT,
        allowNull: false
      },
  }, {
    sequelize,
    modelName: 'nft_setConfig',
    tableName: 'nft_setConfig',
  });
  return nft_setConfig;
};

