'use strict';
const {
  Model
} = require('sequelize');
module.exports = (sequelize, DataTypes) => {
  class nft_tokenstatus extends Model {
    /**
     * Helper method for defining associations.
     * This method is not a part of Sequelize lifecycle.
     * The `models/index` file will call this method automatically.
     */
    static associate(models) {
        
    }
  }
  nft_tokenstatus.init({
    tokenId: {
        type: DataTypes.STRING,
        allowNull: false,
        primaryKey: true,
      },
      currentSupply: {
        type: DataTypes.STRING,
        allowNull: false,
      },
      maxSupplyForToken: {
        type: DataTypes.STRING,
        allowNull: false,
      },
      uniqueMinters: {
        type: DataTypes.STRING,
        allowNull: false,
      },
      isActive: {
        type: DataTypes.BOOLEAN,
        allowNull: false,
      },
      isFull: {
        type: DataTypes.BOOLEAN,
        allowNull: false,
      },
      timeRemaining: {
        type: DataTypes.STRING,
        allowNull: false,
      },
      status: {
        type: DataTypes.STRING,
        allowNull: false,
      },
      startTimestamp: {
        type: DataTypes.STRING,
        allowNull: false,
      },
      endTimestamp: {
        type: DataTypes.STRING,
        allowNull: false,
      },
  }, {
    sequelize,
    modelName: 'nft_tokenstatus',
    tableName: 'nft_tokenstatus',
    timestamps: false,
  });
  return nft_tokenstatus;
};

