require("dotenv").config();
const { nft_mints } = require('../models');
import abi from "../config/contractABI.json";
const fetch = require('node-fetch'); 


const provider = new ethers.providers.JsonRpcProvider(process.env.RPC_URL); // RPC ca TTTChain
const signer = new ethers.Wallet("de1fb4c23bbd4ab579e6a2905b7a99a9c2334dd6c2a639bcfc21d223d87f1199", provider); // Thay PRIVATE_KEY bng private key ca bn

const CONTRACT_ADDRESS = process.env.CONTRACT_ADDRESS;


const contract = new ethers.Contract(CONTRACT_ADDRESS, abi, signer);



export const balanceOf = async (req, res) => {
    try {
      const { user, tokenId } = req.params;
  
      if (!user || tokenId === undefined) {
        return res.status(400).json({ error: "Missing required fields: user or tokenId" });
      }
  
      // 1. Ly s lng NFT user s hu
      const balance = await contract.balanceOf(user, tokenId);
  
      // 2. Ly metadata t baseURI
      const baseURI = "https://plum-solid-ferret-699.mypinata.cloud/ipfs/bafybeibjfnzcwqoo3aahdqgsikqrbgizfb4bqrx5hl3h2dpsqgqyjn73dq/";
      const metadataUrl = `${baseURI}${tokenId}.json`;
  
  
      res.json({
        user,
        tokenId,
        balance: balance.toString(),
      });
    } catch (err) {
      console.error(" balanceOf error:", err);
      res.status(500).json({ error: err.message || "Internal server error" });
    }
  };

